import "./App.css";
import Logo from "./logo/logo";
import Text from "./text/text";
import Icon from "./icons/Icon";
import Button from "./Button/button";
import Ironhack from "./Ironhack/Ironhack";

function App() {
  return (
    <div className="App">
      {/* <Ironhack /> */}
      <Logo />
      <Logo />
      <Text />
      <Button />
      <Icon />
    </div>
  );
}

export default App;
